CREATE TABLE `sys_admin` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `org_id` bigint DEFAULT NULL COMMENT '部门ID',
  `post_id` bigint NOT NULL COMMENT '所属岗位',
  `account` char(24) NOT NULL COMMENT '登录账号',
